# https://leetcode.com/problems/shortest-palindrome/description/
class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        # Find the max palindrome from 0-th to i-th in s
        # If s is already palindrome, no need to add
        # If s doesn't have palindrome, add len(s) - 1 reversed
        def is_palindrome(sub_str):
            if len(sub_str) == 1:
                return True

            left, right = 0, len(sub_str) - 1
            while left < right:
                if sub_str[left] != sub_str[right]:
                    return False
                left, right = left + 1, right - 1
            return True

        i = len(s)
        while True:
            if s[:i] == s[:i][::-1]:
                # At most single char
                break
            i -= 1
        return s[i:][::-1] + s

s = Solution()
my_s = \
""
print(s.shortestPalindrome(my_s))
